"use strict";$.getUrlParam=function(a){var e=new RegExp("(^|&)"+a+"=([^&]*)(&|$)"),r=window.location.search.substr(1).match(e);return null!=r?decodeURI(r[2]):null};var vin=$.getUrlParam("vin");$.ajax({url:"/editCar",type:"POST",data:{vin:vin},async:!0,cache:!1,dataType:"text",success:function(a){if(a){var e=JSON.parse(a)[0],r=e.car_id,c=e.vin,t=e.engine_no,l=e.model,s=e.color,d=e.address,v=e.car_card,n=e.city_name,o=e.model_year,i=e.purchase_date,m=e.car_type,u=e.memo,p=e.status,y=e.create_user_id,h=e.create_time;$("#carId").html(r),$("#vin").html(c),$("#engineNo").val(t),$("#model").val(l),$("#color").val(s),$("#address").val(d),$("#carCard").val(v),$("#cityName").val(n),$("#modelYear").val(o),$("#purchaseDate").val(i),$("#carType").val(m),$("#memo").val(u),$("#status").val(p),$("#createUserId").val(y),$("#createTime").val(h)}else alert("数据传输错误！")}}),$("#confirm").click(function(){$.ajax({url:"/updateCar",type:"POST",data:{carId:$("#carId").html(),vin:$("#vin").html(),engineNo:$("#engineNo").val(),model:$("#model").val(),color:$("#color").val(),address:$("#address").val(),carCard:$("#carCard").val(),cityName:$("#cityName").val(),modelYear:$("#modelYear").val(),purchaseDate:$("#purchaseDate").val(),carType:$("#carType").val(),memo:$("#memo").val(),status:$("#status").val(),createUserId:$("#createUserId").val(),createTime:$("#createTime").val()},async:!0,cache:!1,dataType:"text",success:function(a){a&&(alert("修改车辆信息成功"),location.href="/car")}})});